import React from 'react'
import css from './ShowNumber.module.css';

const ShowNumber = props => {
    let styleNumber = props.state.limit.errorBool == true ? 'colorNumberEnd' : '';
    return (
        <div className={styleNumber}>
            {props.number}
        </div>
    );
};

export default ShowNumber;
